css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix(http://images.google.co.jp/images) {
  a {
    text-decoration: none !important;
  }
  a:link {
    color: #0066cc !important;
  }
  a:visited, a:active {
    color: #ff962d !important;
  }
  a:hover {
    text-decoration: underline !important;
  }

  #navbar {
    position: fixed !important;
    bottom: 0 !important;
    left: 0 !important;
    width: 100% !important;
    height: 8px !important;
    margin: 0 !important;
    padding: 3px 0 0 10px !important;
    border-top: solid 1px #ffc07f !important;
    border-bottom: solid 11px #ffc07f !important;
    background-color: #ffe2b2 !important;
  }
  #navbar *{
    font-size: 10pt !important;
  }
  #navbar div{
    height: 0px !important;
  }
  #navbar tr td:first-child {
    display: none !important;
  }
  #navbar div,#logo span {
    background:url("data:image/png;base64,") !important;
  }
}
